Novonikolayevka () is a rural locality (a selo) in Ullubiyevsky Selsoviet, Tarumovsky District, Republic of Dagestan, Russia. Population:  There are 8 streets.
Geography
Novonikolayevka is located 20&nbsp;km southeast of Tarumovka (the district's administrative centre) by road. Komsomolsky is the nearest rural locality.
